    def get_IQF(self):
        vna = hp.HP8753E()
        I,Q,F = vna.get_IQF_single_meas()
        time.sleep(30)
        vna.set_save_path(r'C:\Users\kid\SynologyDrive\Lab2023\KIDs\QTLab2324\IRdetection\Instruments\Test_data')
        vna.create_run_file(num=1, i=I,q=Q,f=F)
        return

    def reset(self):
        vna = hp.HP8753E()
        vna.reset()
        self.Center_lcd.display(vna.get_center())
        self.Span_lcd.display(vna.get_span())
        self.Points_lcd.display(vna.get_points())
        self.Power_lcd.display(vna.get_power())
        self.IFBW_lcd.display(vna.get_IFBW())
        return 
  
